SELECT all_items.location_code, all_items.temp_location_code, all_items.item_policy, all_items.row_num, all_items.barcode, all_items.mms_id, all_items.material_type, all_items.title FROM (SELECT "Location"."Location Code" location_code, EVALUATE('ROW_NUMBER() OVER (PARTITION BY %1, %2, %3 ORDER BY %4)', "Location"."Location Code", "Physical Item Details"."Item Policy", "Temporary Location"."Temporary Location Code", "Physical Item Details"."Barcode") row_num, "Temporary Location"."Temporary Location Code" temp_location_code, "Physical Item Details"."Barcode" barcode, "Physical Item Details"."Item Policy" item_policy, "Bibliographic Details"."MMS Id" mms_id, "Bibliographic Details"."Material Type" material_type, "Bibliographic Details"."Title" title FROM "Physical Items" WHERE (("Location"."Location Code" IN ('ahsmall', 'archives', 'adjlannex', 'adjlb2', 'adjlgwos', 'adjlpam', 'adjlrr', 'adjltm', 'atbindery', 'damaged', 'damageddsc', 'govfiche', 'grcasr', 'grcasrdup', 'grcasrperm', 'grcasrret', 'grca', 'grcaret', 'grcdp', 'grcdr', 'grcdrdup', 'grcdrperm', 'grcdrret', 'grcmi', 'grcssr', 'grcjp', 'grcjr', 'grcjrperm', 'grcjrret', 'grckr', 'grckrperm', 'grckrret', 'grcm', 'grcmis', 'grcf', 'grcl', 'grcmep', 'grcmer', 'grcmerperm', 'grcmerret', 'grcn', 'grcp', 'grce', 'grceperm', 'grceret', 'grcr', 'grcrdup', 'grcrperm', 'grcrret', 'grctp', 'grctr', 'grctrperm', 'grctrret', 'scrcibt', 'scrcibtret', 'KIEVCIRC', 'microfiche', 'microfilm', 'microforms', 'nsa', 'newspaper', 'nsaironmtn', 'ironmtn', 'oliverref', 'oliverrfov', 'per', 'perdesk', 'readyref', 'readyrperm', 'readyrret', 'ref', 'ref2ndfl', 'ref2nddup', 'ref2ndperm', 'ref2ndret', 'refdeskret', 'refdup', 'refindex', 'refov', 'refovret', 'refperm', 'refret', 'refscrc', 'refscrcret', 'scrc', 'scrcmedia', 'scrca', 'scrccorart', 'scrccor', 'scrcdup', 'scrcexhib', 'kiev', 'kievflatov', 'kievov', 'kievret', 'scrcmaps', 'scrcmfiche', 'scrcmfilm', 'scrcmei', 'scrcmeiff', 'scrcmeif', 'scrcref', 'scrcret', 'scrcvault', 'stacksnc', 'stxncdup', 'stxncperm', 'stxncret', 'stacksovnc', 'stxovncret', 'stacksper', 'stxperret', 'UNASSIGNED', 'unused', 'wrlc stnc', 'wrlc stru')) OR ("Temporary Location"."Temporary Location Code" IN ('wrlc stru', 'wrlc stnc', 'wrlc sgrc'))) AND ("Physical Item Details"."Lifecycle" = 'Active') AND ("Physical Item Details"."Process Type" = 'None') AND ("Holding Details"."Suppressed from Discovery" = 0) AND ("Bibliographic Details"."Suppressed From Discovery" = 'No')) all_items WHERE all_items.row_num = '1'